INSERT INTO `home` (`id`, `create_time`, `description`, `link`, `name`, `title`) VALUES
	(2, '2021-03-04 10:43:20', 'Chúng tôi luôn đặt mục tiêu uy tính và chất lượng lên hàng đầu : Vị trí thuận tiện trong Thành Phố Hồ Chí Minh Phòng có đủ kích cở cho bạn lựa chọn ( từ 10 – 50 người ) Trang thiết bị đầy đủ, tiện nghi và hiện đại Camera an ninh giám sát Thang máy, lối thoát hiểm Trang thiết bị phòng cháy, báo cháy an toàn Có máy phát điện dự phòng Có bảo vệ 24/24 , có hầm để xe rộng rãi, không gian thoáng mát Có nhiều ưu đãi khi đặt và thuê phòng của chúng tôi. * Link :::', 'http://localhost:8080/file/Picture/H%C3%ACnh%20CN%206-20210303055304479.png', '\n<strong>Có phải bạn đang gặp vấn đề về việc tìm và thuê phòng vừa đẹp mà tiện ích theo ý muốn của mình , chúng tôi hiện đang có tất cả những nhu cầu của bạn .Dịch vụ chúng tôi cho thuê bao gồm về phòng dạy học , phòng họp, phòng tổ chức sự kiện, phòng hội thảo , v.v…</strong>', '\n <strong>Tại sao phải thuê phòng của chúng tôi ?</strong> ');
INSERT INTO `introduce` (`id`, `create_time`, `description`, `name`, `operate`, `username`, `file_id`, `title`, `link`) VALUES
	(1, '2021-03-02 08:28:06', '  Khung giờ thuê linh động theo giờ hoặc theo ngày từ 7h30 – 22h (Cả các ngày THỨ 7, CHỦ NHẬT)\n Trang bị đầy đủ ánh sáng, bàn ghế, bảng, loa đài, quạt, điều hòa, tivi, máy tính, đầy đủ rất mới  ', 'Phòng Học IT, phần mềm có máy tính :', NULL, NULL, NULL, '<strong>Phòng phổ thông có sức chứa từ 25 – 40 Người :</strong>', 'http://localhost:8080/file/Picture/introduce-3-20210303031941241.jpg'),
	(2, '2021-03-03 15:20:45', ' Khung giờ thuê linh động theo giờ hoặc theo ngày từ 7h30 – 22h (Cả các ngày THỨ 7, CHỦ NHẬT)\n  Phòng hội họp nhóm, CLB, …\n  Trang bị đầy đủ ánh sáng, bàn ghế, bảng, loa đài, quạt, điều hòa, tivi, đầy đủ rất mới  \n', '<strong>Phòng Hội Cafe, tổ chức sự kiện:</strong>\n', NULL, NULL, NULL, 'Phòng phổ thông có sức chứa từ 25 – 40 Người :\n', 'http://localhost:8080/file/Picture/introduce-2-2021030303192576.jpg'),
	(3, '2021-03-03 15:32:19', 'Khung giờ thuê linh động theo giờ hoặc theo ngày từ 7h30 – 22h(Cả các ngày THỨ 7, CHỦ NHẬT) Phòng học để giảng dạy ngôn ngữ: tiếng Trung, tiếng Hàn, tiếng Nhật,… Phòng hội họp nhóm, CLB, … Trang bị đầy đủ ánh sáng, Bàn ghế, bảng, loa đài, quạt. điều hòa, tivi,đầy đủ rất mới', '<strong>Phòng Học Phổ Thông:</strong>', NULL, NULL, NULL, '<strong>Phòng phổ thông có sức chứa từ 25 – 40 HS :</strong>', 'http://localhost:8080/file/Picture/introduce-2-2021030303192576.jpg');
